import React from 'react';
import Home from './components/Home';
import Navbar from './components/Navbar';
import AboutUs from './components/AboutUs';
import Services from './components/Services';
import Suscribe from './components/Suscribe';
import Destiny from './components/Destiny';
import Productos from './components/Productos';
import Contact from './components/Contact';
import Footer from './components/Footer';
import Terms from './components/Terms';


function App() {
  return (
    <div className="App">
      <body>
        <Home />
        <Navbar />
        <AboutUs />
        <Services />
        <Suscribe />
        <Destiny title={"Costa Rica's Hotels"} images={["portfolio-5.jpg","portfolio-4.jpg","portfolio-3.jpg","portfolio-2.jpg","portfolio-1.jpg"]}
        names={["Occidental Tamarindo","Baldi","La Kukula Logde","Villas Nicolas","Elan at Ballena Beach"]}/>
        <Destiny title={"International Hotels"} images={["portfolio-6.jpg","portfolio-7.jpg","portfolio-8.jpg","portfolio-9.jpg","portfolio-10.jpg"]}
        names={["Ryumeikan","Las Flores","Icon","Almanac","The Westin Resort"]}/>
        <Productos title={"National Travels"}/>
        <Productos title={"International Travels"}/>
         <Terms/>
        <Contact />
        <Footer />

      </body>
    </div>
  );
}

export default App;
